let data = require('../env');
import { managerAdmin, organization, user } from '../env'
import registrationPage from '../POs/registration.po';
import loginPage from '../POs/login.po';
import usersPage from '../POs/users.po';
import userShowPage from '../POs/usersShow.po';
import userProfilePage from '../POs/userProfile.po';
import usersEditPage from '../POs/usersEdit.po';
import homePage from '../POs/home.po';
import organizationsPage from '../POs/organizations.po';
import organizationsShowPage from '../POs/organizationsShow.po';
var assert = require('assert');
let email;
let password;
let userId;
let organizationId;

describe('Test successful registration', () => {
    it('Fill out and submit the registration form', () => {
        registrationPage.open();
        registrationPage.clickRegister();
        registrationPage.selectSalutation(user.salutation.value);
        registrationPage.provideUserTitle(user.title.value);
        registrationPage.provideUserFirstName(user.firstName.value);
        registrationPage.provideUserLastName(user.lastName.value);
        registrationPage.provideUserFunction(user.function.value);
        registrationPage.provideUserDepartment(user.department.value);
        registrationPage.provideUserPhoneNumber(user.phoneNumber.value);
        registrationPage.provideUserEmail(user.email.value);
        registrationPage.providePassword(user.password.value);
        registrationPage.providePasswordConfirmation(user.password.value);
        registrationPage.provideOrganizationName(organization.name.value);
        registrationPage.selectOrganizationRole();
        registrationPage.specifyOrganizationResponsible(organization.responsible.value);
        registrationPage.provideOrganizationAddress(organization.address.line1, organization.address.line2);
        registrationPage.provideOrganizationPostalCode(organization.postalCode.value);
        registrationPage.provideOrganizationCity(organization.city.value);
        registrationPage.provideOrganizationState(organization.state.value);
        registrationPage.provideOrganizationCountry();
        registrationPage.provideOrganizationWebsite(organization.website.value);
        registrationPage.provideMotivation(organization.motivation.value);
        registrationPage.acceptTermsAndConditions();
        registrationPage.submitRegistrationForm();
    })
    it('First login as admin', () => {
        loginPage.login(managerAdmin.email.value, managerAdmin.password.value);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Get the user id', () => {
        usersPage.open();
        $(`//*[text()="${user.email.value}"]`).click();
        let url = browser.getUrl()
        userId = url.split('/').pop(); 
        console.log('userId', userId)
    })
    it('Accept the user', () => {
        userShowPage.clickActions();
        $(`a[href="/users/${userId}/accept"]`).click();
        browser.acceptAlert();
    })
    it('Activate the user', () => {
        userShowPage.clickActions();
        $(`a[href="/users/${userId}/activate"]`).click();
        browser.acceptAlert();
    })
    it("First log out from the admin's account", () => {
        userShowPage.logOut();
    })
    it('Log in as the user', () => {
        loginPage.login(`${user.email.value}`, `${user.password.value}`);
        let successfulLoginMessage = $('#flashnotice-body').getText();
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.');
    })
    it('Edit the information as the user', () => {
        $(`//*[text()="${user.firstName.value} ${user.lastName.value}"]`).click()
        userProfilePage.clickActions();
        $(`a[href="/users/${userId}/edit"]`).click();
        usersEditPage.provideUpdatedUserEmail(user.email.updatedValue);
        usersEditPage.provideUpdatedPassword(user.password.updatedValue);
        usersEditPage.providePasswordConfirmation(user.password.updatedValue);
        usersEditPage.clickSave();
    })
    it('Log out of the user"s account', () => {
        userShowPage.logOut();
    })
    it('Login as the user with the new credentials', () => {
        loginPage.login(`${user.email.updatedValue}`, `${user.password.updatedValue}`);
        let successfulLoginMessage = $('#flashnotice-body').getText();
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.');
    })
    it('Second logout from the user"s account', () => {
        homePage.logOut();
    })
    it('Second login as admin', () => {
        loginPage.login(managerAdmin.email.value, managerAdmin.password.value);
        let successfulLoginMessage = $('#flashnotice-body').getText();
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.');
    })
    it('Edit the user data as admin', () => {
        usersPage.open();
        $(`a[href="/users/${userId}"]`).click();
        userShowPage.clickActions();
        $(`a[href="/users/${userId}/edit"]`).click();
        usersEditPage.provideUpdatedFirstName(user.firstName.updatedValue);
        usersEditPage.provideUpdatedLastName(user.lastName.updatedValue);
        usersEditPage.clickSave();
    })
    it('Make sure the user data has been updated', () => {
        let header = $('.show_header')
        expect(header).toHaveTextContaining(`${user.firstName.updatedValue} ${user.lastName.updatedValue}`)
    })
    it('Get the organization id', () => {
        usersPage.open();
        $(`//*[text()="${organization.name.value}"]`).waitForDisplayed(10000)
        $(`//*[text()="${organization.name.value}"]`).click();
        let url = browser.getUrl()
        organizationId = url.split('/').pop(); 
        console.log('organizationId', organizationId)
    })
    /*it('Deactivate the organization', () => {
        organizationsPage.open();
        $(`a[href="/organizations/${organizationId}"]`).click();
        organizationsShowPage.clickActions();
        $(`a[href="/organizations/${organizationId}/deactivate"]`).click();
        browser.acceptAlert();
    })
    it('Make sure the organization has been deactivated', () => {
        $('//h1[text()="504 Gateway Time-out"]').waitForDisplayed(300000);
        
    })
    it('Try to log in as the inactive user', () => {
        loginPage.login(`${user.email.updatedValue}`, `${user.password.updatedValue}`);
        $('//*[text()="Your account is not active."]').waitForDisplayed(10000);
    })*/
})

