const assert = require('assert');

export default class Page {
    open() {
        browser.url('/')
    }
    clickNew() {
        $('.icon.icon_new').click()
    }
    clickActions() {
        $('.icon.icon_actions').click()
    }
    clickActionsButton() {
        $('(//*[text()="Actions"])[last()]').waitForExist({reverse: false, timeout: 10000})
        $('(//*[text()="Actions"])[last()]').click()
    }
    hoverActions() {
        $('.icon.icon_actions').waitForExist({reverse: false, timeout: 10000})
        $('.icon.icon_actions').moveTo(0,0)
    }
    hoverActionsButton() {
        $('(//*[text()="Actions"])[last()]').waitForExist({reverse: false, timeout: 10000})
        $('(//*[text()="Actions"])[last()]').moveTo(0,0)
    }
    clickSave() {
        $('input[value="Save"]').click()
    }
    logOut() {
        $('a[href="/logout"]').click();
        browser.acceptAlert();
    }
    goToExpertOptionsTab() {
        $('a[href="#expert"]').click()
    }
    elementNotPresentCheck(element) {
        $(element).waitForExist({reverse: true})
    }
    elementPresentCheck(element) {
        $(element).waitForExist({reverse: false, timeout: 10000})
    }
    elementWasCreatedCheck(text) {
        assert.strictEqual($('.show_header').getText(), text)
    }
    elementWasUpdatedCheck(text) {
        assert.strictEqual($('.show_header').getText(), text)
    }
    clickEntryOptions() {
        $('a[href="#entry"]').click()
    }
    clickExpertOptions() {
        $('a[href="#expert"]').click()
