let data = require('../data/env');
import Page from './base.po'

class loginPage extends Page {
    providecredentials(email, password) {
        $('#user_email').setValue(email)
        $('#user_password').setValue(password)
    }
    clickLogin() {
        $('input[value="Login"]').click()
    }
    verifySuccessfulLogin() {
        $('#flashnotice-body')
        expect('#flashnotice-body').toHaveText('Signed in successfully.')
    }
    getUrl() {
        browser.getUrl()
        expect(browser).toHaveUrl(`${data.url}/home`)
    }
    getMessage() {
        $('#flashnotice-body')
    }
    login(email, password) {
        this.open();
        this.providecredentials(email, password);
        this.clickLogin();
    }
}

export default new loginPage();

