        $(userSalutation).click()
        //$('#organization_user_salutation_id :nth-child(2)').click(userSalutation)
    }
    provideUserTitle(userTitle) {
        $('#organization_user_title').setValue(userTitle)
    }
    provideUserFirstName(userFirstName) {
        $('#organization_user_first_name').setValue(userFirstName)
    }
    provideUserLastName(userLastName) {
        $('#organization_user_last_name').setValue(userLastName)
    }
    provideUserFunction(userFunction) {
        $('#organization_user_function').setValue(userFunction)
    }
    provideUserDepartment(userDepartment) {
        $('#organization_user_department').setValue(userDepartment)
    }
    provideUserPhoneNumber(userPhoneNumber) {
        $('#organization_user_phone').setValue(userPhoneNumber)
    }
    provideUserEmail(userEmail) {
        $('#organization_user_email').setValue(userEmail)
    }
    providePassword(userPassword) {
        $('#organization_user_password').setValue(userPassword)
    }
    providePasswordConfirmation(passwordConfirmation) {
        $('#organization_user_password_confirmation').setValue(passwordConfirmation)
    }
    provideOrganizationName(organizationName) {
        $('#organization_name').setValue(organizationName)
    }
    selectOrganizationRole() {
        $('#organization_organization_role_id').click()
        $('#organization_organization_role_id :nth-child(3)').click()
    }
    specifyOrganizationResponsible(organizationResponsible) {
        $('#organization_responsible').setValue(organizationResponsible)
    }
    provideOrganizationAddress(organizationAddressLine1, organizationAddressLine2) {
        $('#organization_address_line_one').setValue(organizationAddressLine1)
        $('#organization_address_line_two').setValue(organizationAddressLine2)
    }
    provideOrganizationPostalCode(organizationPostalCode) {
        $('#organization_postal_code').setValue(organizationPostalCode)
    }
    provideOrganizationCity(organizationCity) {
        $('#organization_city').setValue(organizationCity)
    }
    provideOrganizationState(organizationState) {
        $('#organization_state').setValue(organizationState)
    }
    provideOrganizationCountry(country) {
        $('#organization_country').click()
        $(country).click()
    }
    provideOrganizationWebsite(organizationWebsite) {
        $('#organization_website').setValue(organizationWebsite)
    }
    provideMotivation(motivation) {
        $('#organization_motivation').setValue(motivation)
    }
    acceptTermsAndConditions() {
        $('#accept_terms').click()
    }
    submitRegistrationForm() {
        $('#registerBtn').click()
    }
}

export default new registrationPO();

