let data = require('../data/env');
import { managerAdmin, instance, keyPair, domainName, firewallRuleSet } from '../data/env';
import loginPage from '../POs/login.po';
import keyPairsPage from '../POs/keyPairs.po';
import keyPairsNewPage from '../POs/keyPairsNew.po';
import keyPairsShowPage from '../POs/keyPairShow.po';
import DNSPage from '../POs/DNS.po';
import DNSnewPage from '../POs/DNSnew.po';
import DNSshowPage from '../POs/DNSshow.po';
import instancesPage from '../POs/instances.po';
import instancesNewPage from '../POs/instancesNew.po';
import instancesShowPage from '../POs/instancesShow.po';
import instancesEditPage from '../POs/instancesEdit.po';
var assert = require('assert');
let keyPairId;
let DNSid;
let instanceId;
let instanceIp;
let instancePwd;
let instanceStatus;
let host;
let SSH;
let callback;
let isDisplayed;

describe('Launch, edit, stop the instance', () => {
    it('Create a key pair', () => {
        keyPairsPage.open();
        keyPairsPage.clickNew();
        keyPairsNewPage.provideKeyPairName(keyPair.name.value);
        keyPairsNewPage.provideKeyPairPublicKey(keyPair.publicKey.updatedValue);
        keyPairsNewPage.clickSave();
    })
    it('Make sure the key pair was created', () => {
        keyPairsShowPage.elementWasCreatedCheck(`${keyPair.name.value}`);
    })
    it('Get the key pair id', () => {
        browser.getUrl()
        console.log()
          let link = browser.getUrl()
          console.log(link)
          keyPairId = link.split('/').pop();
          console.log(keyPairId);
    })
    it('Create DNS', () => {
        DNSPage.open();
        DNSPage.clickNew();
        DNSnewPage.provideDNSsubdomain(domainName.subdomain.value);
        DNSnewPage.clickSave();
    })
    it('Make sure DNS has been created', () => {
        DNSshowPage.elementWasCreatedCheck(`${domainName.subdomain.value}`);
    })
    it('Get DNS id', () => {
        browser.getUrl()
        console.log()
          let link = browser.getUrl()
          console.log(link)
          DNSid = link.split('/').pop();
          console.log(DNSid);
    })
    it('Configure the instance', () => {
        instancesPage.open();
        instancesPage.clickLaunchNewInstance();
        instancesNewPage.provideInstanceName(instance.name.value);
        instancesNewPage.selectSoftware(instance.software.value);
        instancesNewPage.selectResource(instance.resource.value);
        instancesNewPage.selectInstanceType(instance.instanceType.value);
        instancesNewPage.goToExpertOptionsTab();
        instancesNewPage.checkmarkIsolatedCheckbox();
        instancesNewPage.checkmarkAutogenerateConnectionPassword();
        instancesNewPage.provideFirewallRules(firewallRuleSet.port.SSH, firewallRuleSet.ip.value, firewallRuleSet.port.HTTPS, firewallRuleSet.ip.value);
        instancesNewPage.selectKeyPair(`option[value="${keyPairId}"]`);
        instancesNewPage.selectDomainName(`option[value="${DNSid}"]`);
        instancesNewPage.clickSaveAndLaunchInstance();
    })
    it('Get the instance ID', () => {
        instancesPage.open();
        let link = $(`//a[text()="${instance.name.value}"]`).getAttribute('href')
        console.log(link)
        instanceId = link.split('/').pop();
        console.log('instanceId', instanceId);
    })
    /*it('Wait for the instance to become starting', () => {
        browser.waitUntil(
            () => $(`#${instanceId}.status_icon`).getText() === 'starting',
            {
                timeout: 80000,
                timeoutMsg: 'expected text to be "starting" after 80s'
            }
        );
    });*/
    it('Wait for the instance to become starting', () => {
        browser.pause(1000)
        browser.refresh();
        instanceStatus = $(`//*[@id="${instanceId}"][@class="status_icon"]`)
        expect(instanceStatus).toHaveTextContaining('starting')
    }, 10)
    it('Wait for the instance to become running', () => {
        browser.pause(10000)
        browser.refresh();
        instanceStatus = $(`//*[@id="${instanceId}"][@class="status_icon"]`)
        expect(instanceStatus).toHaveTextContaining('running')
    }, 18)
    it('Get the instance IP', () => {
        instanceIp = $(`//td[@id="${instanceId}"]`).getText();
        console.log('instanceIp', instanceIp);
    })
    it('Get the autogenerated password', () => {
        $(`a[href="/instances/${instanceId}"]`).click();
        instancesShowPage.goToSSHtab();
        instancePwd = $('#autopasswd').getText()
        console.log('instancePwd', instancePwd)
        instancesPage.clickActions()
    })
    it('Connect to the instance with ip and autogenerated password', () => {
        browser.pause(1000)
        host = {
            server:              {       
              host:         `${instanceIp}`,
              port:         "22",
              userName:     "ubuntu",
              password:   `${instancePwd}`, //optional default:""
            },
            hosts:               [], //optional default:[]
            commands:            ["echo 'Hello'", "touch Hello.txt", "touch deplTest.txt", "ls -a", "exit"],
            msg:                 {
              send: function( message ) {
                //message handler code
              }
            },
        }
        var SSH2Shell = require ('ssh2shell')
        SSH = new SSH2Shell(host),
        callback = function(sessionText){
            console.log(sessionText)
        }
        SSH.connect(callback);
    })
    it('Connect to the instance with DNS and key pair', () => {
        browser.pause(1000)
        host = {
            server:              {       
              host:         `WDIO-autotest-DNS-Javonte.cbp-routing.ch`,
              port:         "22",
              userName:     "ubuntu",
              passPhrase:   `${keyPair.passphrase.value}`,
              privateKey:   require('fs').readFileSync(`${keyPair.path.value}`),
            },
            hosts:               [], //optional default:[]
            commands:            ["echo 'Hello'", "touch Hello.txt", "touch deplTest.txt", "ls -a", "exit"],
            msg:                 {
              send: function( message ) {
                //message handler code
              }
            },
        }
        var SSH2Shell = require ('ssh2shell')
        SSH = new SSH2Shell(host),
        callback = function(sessionText){
            console.log(sessionText)
        }
        SSH.connect(callback);
    })
    it('Edit the instance', () => {
        instancesShowPage.clickActions();
        $(`a[href="/instances/${instanceId}/edit"]`).click();
        instancesEditPage.provideUpdatedInstanceName(instance.name.updatedValue);
        instancesEditPage.goToExpertOptionsTab();
        instancesEditPage.clickAddFirewallRule();
        instancesEditPage.addFirewallRuleRDP(firewallRuleSet.port.RDP, firewallRuleSet.ip.value);
        $(`[onclick="removeInstanceKeyPair('${keyPairId}','${keyPair.name.value}')"]`).click();
        instancesEditPage.clickUpdateInstance();
    })
    it('Make sure the instance has been updated', () => {
        instancesEditPage.goToExpertOptionsTab();
        let RDPport = $('//*[text()="3389"]')
        expect(RDPport).toBeVisible();
        let keyPair = $(`a[href="/key_pairs/${keyPairId}"]`)
        expect(keyPair).not.toBeVisible();
    })
    it('Stop the instance', () => {
        $(`(//*[text()="Actions"])[last()]`).click();
        $(`a[href="/instances/${instanceId}/stop"]`).click();
        browser.acceptAlert();
    })
    it('Wait for the instance to become stopping', () => {
        instancesPage.open();
        browser.pause(5000)
        browser.refresh();
        instanceStatus = $(`//*[@id="${instanceId}"][@class="status_icon"]`)
        expect(instanceStatus).toHaveTextContaining('stopping')
    })
    it('Wait for the instance to become halted', () => {
        browser.pause(180000)
        browser.refresh();
        instanceStatus = $(`//*[@id="${instanceId}"][@class="status_icon"]`)
        expect(instanceStatus).toHaveTextContaining('halted')
    })
    it('Delete the key pair', () => {
        keyPairsPage.open();
        $(`.listTable a[href="/key_pairs/${keyPairId}"]`).click();
        keyPairShowPage.clickActions();
        $(`a[href="/key_pairs/${keyPairId}"][data-method="delete"]`).click();
        browser.acceptAlert();
    })
    it('Make sure the key pair has been deleted', () => {
        keyPairsPage.elementNotPresentCheck(`a[href="/key_pairs/${keyPairId}"]`);
    })
    it('Delete DNS', () => {
        DNSPage.open();
        $(`a[href="/dynamic_domain_names/${DNSid}"]`).click();
        DNSshowPage.clickActions();
        let deleteButton = `a[href="/dynamic_domain_names/${DNSid}"][data-method="delete"]`
        $(deleteButton).click()
        browser.acceptAlert();
    })
    it('Make sure DNS has been deleted', () => {
        DNSPage.elementNotPresentCheck(`a[href="/dynamic_domain_names/${DNSid}"]`);
    })
})

