    provideInstanceName(instanceName) {
        $('#instance_name').setValue(instanceName)
    }
    selectSoftware(instanceSoftware) {
        $('#instance_software_id').click()
        $(instanceSoftware).click()
    }
    selectResource(instanceResource) {
        $('#instance_resource_id').click()
        $(instanceResource).click()
    }
    selectInstanceType(instanceType) {
        $('#instance_instance_type_id').click()
        $(instanceType).click()
    }
    goToExpertOptionsTab() {
        $('a[href="#expert"]').click()
    }
    checkmarkIsolatedCheckbox() {
        $('#instance_isolated').click()
    }
    checkmarkAutogenerateConnectionPassword() {
        $('#instance_autogenerate_connection_password').click()
    }
    clickAddFirewallRule() {
        $('.icon.icon_new').click()
    }
    addFirewallRuleSSH(sshPort, sshIp) {
        $('#firewall_rules_1_from_port').setValue(sshPort)
        $('#firewall_rules_1_ip').setValue(sshIp)
    }
    addFirewallRuleHTTPS(httpsPort, httpsIp) {
        $('#firewall_rules_2_from_port').setValue(httpsPort)
        $('#firewall_rules_2_ip').setValue(httpsIp)
    }
    provideFirewallRules(sshPort, sshIp, httpsPort, httpsIp) {
        this.clickAddFirewallRule()
        this.addFirewallRuleSSH(sshPort, sshIp)
        this.clickAddFirewallRule()
        this.addFirewallRuleHTTPS(httpsPort, httpsIp)
    }
    selectKeyPair(keyPair) {
        $('#instance_key_pair_id').click()
        $(keyPair).click()
    }
    selectDomainName(DNS) {
        $('#instance_domain_name_id').click()
        $(DNS).click()
    } 
    clickSaveAndLaunchInstance() {
        $('input[value="Save & Launch Instance"]').click()
    }
}

export default new instancesNewPO();

