    goToSSHtab() {
        $('a[href="#ssh_div"]').click()
    }
    clickGenerateDeployment() {
        $('.icon.icon_deployment').waitForExist({reverse: false, timeout: 10000})
        $('.icon.icon_deployment').click();
    }
    confirmDeploymentGeneration() {
        $('input[value="Generate deployment"]').waitForExist({reverse: false, timeout: 10000})
        $('input[value="Generate deployment"]').click();
    }
}

export default new instancesShowPO();

