import Page from './base.po';

class instancesEditPO extends Page {
    provideUpdatedInstanceName(updatedInstanceName) {
        $('#instance_name').clearValue();
        $('#instance_name').setValue(updatedInstanceName);
    }
    clickAddFirewallRule() {
        $('.icon.icon_new').click()
    }
    addFirewallRuleRDP(rdpPort, rdpIp) {
        $('#firewall_rules_3_from_port').setValue(rdpPort)
        $('#firewall_rules_3_ip').setValue(rdpIp)
    }
    clickUpdateInstance() {
        $('input[value="Update Instance"]').click();
    }
}

export default new instancesEditPO();

