        softwareNewPage.provideSoftwareVersion(software.version.value);
        softwareNewPage.selectOrganization(software.organization.value);
        softwareNewPage.selectSoftwareVisibility(software.visibility.protected);
        softwareNewPage.clickSaveSoftware();
    })
