let data = require('../data/env');
import { managerAdmin, organization, user } from '../data/env';
import loginPage from '../POs/login.po';
import usersPage from '../POs/users.po';
import usersNewPage from '../POs/usersNew.po';
import usersShowPage from '../POs/usersShow.po';
import userProfilePage from '../POs/userProfile.po';
import usersEditPage from '../POs/usersEdit.po';
let userId;

var assert = require('assert');

describe('Test new user creation', () => {
    /*before('Login', () => {
        loginPage.login(managerAdmin.email.value, managerAdmin.password.value);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })*/
    it('Create a new user', () => {
        usersPage.open();
        usersPage.clickNew();
        usersNewPage.provideUserEmail(user.email.value);
        usersNewPage.provideUserPassword(user.password.value);
        usersNewPage.providepasswordConfirmation(user.password.value);
        usersNewPage.selectSalutation(user.salutation.value);
        usersNewPage.provideUserFirstName(user.firstName.value);
        usersNewPage.provideUserLastName(user.lastName.value);
        usersNewPage.selectOrganization(organization.value);
        usersNewPage.providePhoneNumber(user.phoneNumber.value);
        usersNewPage.clickSaveUser();
        browser.acceptAlert();
    })
    it('Make sure the user has been created', () => {
        $('#flashnotice-body').waitForExist(10000);
        expect($('#flashnotice-body')).toHaveTextContaining(`User was successfully created.`);
        $('.show_header').waitForExist(10000);
        expect($('.show_header')).toHaveTextContaining(`${user.firstName.value} ${user.lastName.value}`);
    })
    it('Get the user ID', () => {
        browser.getUrl()
        console.log()
          let link = browser.getUrl()
          console.log(link)
          userId = link.split('/').pop();
          console.log('userId', userId);
    })
    it('Log out of the Manager Admin"s account', () => {
        usersShowPage.logOut();
    })
    it('Log in as the new user', () => {
        loginPage.login(`${user.email.value}`, `${user.password.value}`);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Make sure that the correct user is logged in', () => {
        $(`//a[text()="${user.firstName.value} ${user.lastName.value}"]`).waitForExist(10000);
    })
    it('Edit the user"s profile', () => {
        $(`a[href="/users/${userId}"]`).click();
        userProfilePage.clickActionsButton();
        $(`a[href="/users/${userId}/edit"]`).click();
        usersEditPage.provideUpdatedUserEmail(user.email.updatedValue);
        usersEditPage.provideUpdatedPassword(user.password.updatedValue);
        usersEditPage.providePasswordConfirmation(user.password.updatedValue);
        usersEditPage.clickSave();
    })
    it('First logout from the user"s account', () => {
        usersShowPage.logOut();
    })
    it('Log in as the user with the new credentials', () => {
        loginPage.login(`${user.email.updatedValue}`, `${user.password.updatedValue}`);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Second logout from the user"s account', () => {
        usersShowPage.logOut();
    })
    it('Log in as Manager Admin', () => {
        loginPage.login(managerAdmin.email.value, managerAdmin.password.value);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Edit the user as Manager Admin', () => {
        usersPage.open();
        $(`a[href="/users/${userId}"]`).waitForExist(10000);
        $(`a[href="/users/${userId}"]`).click();
        usersShowPage.clickActionsButton();
        $(`a[href="/users/${userId}/edit"]`).waitForExist(10000);
        $(`a[href="/users/${userId}/edit"]`).click();
        usersEditPage.provideUpdatedFirstName(user.firstName.updatedValue);
        usersEditPage.provideUpdatedLastName(user.lastName.updatedValue);
        usersEditPage.clickSave();
    })
    it('Make sure the user has been updated', () => {
        $('#flashnotice-body').waitForExist(10000);
        expect($('#flashnotice-body')).toHaveTextContaining(`User was successfully updated.`);
        $('.show_header').waitForExist(10000);
        expect($('.show_header')).toHaveTextContaining(`${user.firstName.updatedValue} ${user.lastName.updatedValue}`);
    })
    it('Deactivate the user', () => {
        usersShowPage.clickActionsButton();
        $(`a[href="/users/${userId}/deactivate"]`).click();
        browser.acceptAlert();
    })
    it('Make sure the user has been deactivated', () => {
        usersShowPage.clickActionsButton();
        $(`a[href="/users/${userId}/activate"]`).waitForExist(10000);
    })
})

