let data = require('../data/env');
import { user } from '../data/env';
import loginPage from '../POs/login.po';
var assert = require('assert');

describe('Check login with invalid/valid credentials', () => {
    it('Login with invalid email and invalid passowrd should fail', () => {
        loginPage.login(user.email.invalidEmail, user.password.invalidPassword);
        $(`//*[text()="Invalid Email or password."]`).waitForDisplayed(5000)
    })
    it('Login with valid email and invalid passowrd should fail', () => {
        loginPage.login(user.email.adminResourceProvider, user.password.invalidPassword);
        $(`//*[text()="Invalid Email or password."]`).waitForDisplayed(5000)
    })
    it('Login with invalid email and valid passowrd should fail', () => {
        loginPage.login(user.email.invalidEmail, user.password.adminResourceProvider);
        $(`//*[text()="Invalid Email or password."]`).waitForDisplayed(5000)
    })
    it('Login with valid email and valid passowrd should fail', () => {
        loginPage.login(user.email.adminResourceProvider, user.password.adminResourceProvider);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
})

