import Page from './base.po'

class registrationGuardPO extends Page {
    clickEdit() {
        $('.icon.icon_edit').click();
    }
    disableCaptcha() {
        this.clickActions();
        this.clickEdit();
        $('#admin_setting_value').clearValue()
        $('#admin_setting_value').setValue('none')
        this.clickSave()
    }
    enableCaptcha() {
        this.clickActions();
        this.clickEdit();
        $('#admin_setting_value').clearValue()
        $('#admin_setting_value').setValue('captcha')
        this.clickSave()
    }
}

export default new registrationGuardPO();

