let data = require('../data/env');
import { firewallRuleSet } from '../data/env';
import firewallRuleSetsPage from '../POs/firewallRuleSets.po';
import firewallRuleSetNewPage from '../POs/firewallRuleSetNew.po';
import firewallRuleSetShowPage from '../POs/firewallRuleSetShow.po';
import firewallRuleSetEditPage from '../POs/firewallRuleSetEdit.po';
import firewallRuleSetShowPo from '../POs/firewallRuleSetShow.po';
let link;
let firewallRuleSetId;

describe('Create, edit, delete firewall rule set', () => {
    it('Create a firewall rule set', () => {
        firewallRuleSetsPage.open();
        firewallRuleSetsPage.clickNew();
        firewallRuleSetNewPage.provideFirewallRuleSetName(firewallRuleSet.name.value);
        firewallRuleSetNewPage.clickAddFirewallRule();
        firewallRuleSetNewPage.provideFirewallRule1Port(firewallRuleSet.port.SSH);
        firewallRuleSetNewPage.provideFirewallRule1Ip(firewallRuleSet.ip.value);
        firewallRuleSetNewPage.clickAddFirewallRule();
        firewallRuleSetNewPage.provideFirewallRule2Port(firewallRuleSet.port.HTTPS);
        firewallRuleSetNewPage.provideFirewallRule2Ip(firewallRuleSet.ip.value);
        firewallRuleSetNewPage.clickSave();
    })
    it('Make sure the firewall rule set has been created', () => {
        firewallRuleSetShowPage.elementWasCreatedCheck(`${firewallRuleSet.name.value}`);
    })
    it('Get the firewall rule set id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          firewallRuleSetId = link.split('/').pop();
          console.log(firewallRuleSetId);
    })
    it('Edit the firewall rule set', () => {
        firewallRuleSetShowPage.hoverActions();
        $(`a[href="/firewall_rule_sets/${firewallRuleSetId}/edit"]`).click();
        firewallRuleSetEditPage.provideUpdatedFirewallRuleSetName(firewallRuleSet.name.updatedValue);
        firewallRuleSetEditPage.clickAddFirewallRule();
        firewallRuleSetEditPage.provideFirewallRule3Port(firewallRuleSet.port.RDP);
        firewallRuleSetEditPage.provideFirewallRule3Ip(firewallRuleSet.ip.value);
        firewallRuleSetEditPage.clickSave();
    })
    it('Make sure the firewall rule set has been updated', () => {
        firewallRuleSetShowPo.elementWasUpdatedCheck(`${firewallRuleSet.name.updatedValue}`);
    })
    it('Delete the firewall rule set', () => {
        firewallRuleSetShowPage.hoverActions();
        let deleteButton = `a[href="/firewall_rule_sets/${firewallRuleSetId}"][data-method="delete"]`
        $(deleteButton).click()
        browser.acceptAlert();
    })
    it('Make sure the firewall rule set has been deleted', () => {
        firewallRuleSetsPage.elementNotPresentCheck(`a[href="/key_pairs/${firewallRuleSetId}"]`)
    })
})

