let data = require('../data/env');
import { keyPair } from '../data/env';
import keyPairsPage from '../POs/keyPairs.po';
import keyPairsNewPage from '../POs/keyPairsNew.po';

describe("Create, edit, delete the key pair", function() {
    it('No name', () => {
        keyPairsPage.open();
        keyPairsPage.clickNew();
        keyPairsNewPage.provideKeyPairPublicKey(keyPair.publicKey.value);
        keyPairsNewPage.clickSave();
    })
    it('Make sure it is impossible to save a key pair without a name', () => {
        $(`//*[text()="Name can't be blank"]`).waitForDisplayed({timeout: 10000});
    })
    it('Empty public key', () => {
        keyPairsNewPage.provideKeyPairName(keyPair.name.value);
        keyPairsNewPage.clearElementValue('#key_pair_public_key');
        keyPairsNewPage.clickSave();
    })
    it('Make sure it is impossible to save a key pair without a public key', () => {
        $(`//*[text()="Public key can't be blank"]`).waitForDisplayed({timeout: 10000});
        $(`//*[text()="Public key is expected to start with ssh-rsa"]`).waitForDisplayed({timeout: 10000});
    })
    it('Invalid public key', () => {
        keyPairsNewPage.provideKeyPairName(keyPair.name.value);
        keyPairsNewPage.provideKeyPairPublicKey(keyPair.publicKey.invalid);
        keyPairsNewPage.clickSave();
    })
    it('Make sure it is impossible to save a key pair without an invalid public key', () => {
        $(`//*[text()="Public key is expected to start with ssh-rsa"]`).waitForDisplayed({timeout: 10000});
    })
})

